class Notice {
    id;
    title;
    markdownContents;
    noticeStartDate;
    noticeEndDate;
    updateDate;
    generateDate;

    constructor(data={}) {
        if (data == null) data = {};
        Object.assign(this, data);
    }
}

export default Notice;
